import React, { Component } from 'react';

import './App.css';

class NavBar extends React.Component {
  render() {
    return (
      <div className=".container-fluid">
        <nav className="navbar navbar-expand-sm bg-dark navbar-dark fixed-top">
          <ul className="navbar-nav">
            <li className="nav-item"> <a className="nav-link" href="#section1">Section 1</a></li>
            <li className="nav-item"> <a className="nav-link" href="#section2">Section 2</a>
            </li><li className="nav-item"> <a className="nav-link" href="#section3">Section 3</a></li>
          </ul>
        </nav>

        <div className="col-sm-9 col-8">
        <div id="section1" className="bg-success">
        <h1>Section 1</h1>
        <p data-spy="scroll" data-target=".navbar">Try to scroll this section and look at the navigation list while scrolling!</p>
        </div>
        <div id="section2" className="bg-warning">
        <h1>Section 2</h1>
        <p data-spy="scroll" data-target=".navbar">Try to scroll this section and look at the navigation list while scrolling!</p>
        </div>
        <div id="section3" className="bg-secondary">
        <h1>Section 3</h1>
        <p data-spy="scroll" data-target=".navbar">Try to scroll this section and look at the navigation list while scrolling!</p>
        </div>
      </div>
      </div>

    );
  }
}

export default NavBar;
